const initialState = {
  images: [
    {
      uri:
        'data:image/png;base64,',
    },
    {
      uri:
        'data:image/jpeg;base64,',
    },
    {
      uri:
        'data:image/jpeg;base64,',
    },
    {
      uri:
        'data:image/jpeg;base64,',
    },
    {
      uri:
        'data:image/jpeg;base64,',
    },
    {
      uri:
        'data:image/jpeg;base64,',
    },
  ],

  name: '',
  description: '',
  section: 'انتخاب',

  location: 'انتخاب',
  type: 'فروشی',
  state: 'نوع',
  price: 'تعین',
  wantChange: false,
  phone: '',
  count: 1,
};

const ThingSpecificationReducer = (state = initialState, action) => {
  switch (action.type) {
    case 'ADD': {
      const count = state.count;
      if (state.images.length === 6 && count < 6) {
        let newImages = [];

        state.images.pop();

        for (i = 0; i < count; i++) {
          newImages[i] = state.images.shift();
        }
        newImages = [...newImages, action.value];
        return {
          ...state,
          images: [...newImages, ...state.images],
          count: count + 1,
        };
      } else {
        return {...state, images: [...state.images, action.value]};
      }
    }

    case 'ADD_NAME':
      return {...state, name: action.value};

    case 'ADD_DESCRIPTION':
      return {...state, description: action.value};

    case 'ADD_SECTION':
      return {...state, section: action.value};

    case 'ADD_LOCATION':
      return {...state, location: action.value};

    case 'ADD_TYPE':
      return {...state, type: action.value};

    case 'ADD_STATE':
      return {...state, state: action.value};

    case 'ADD_PRICE':
      return {...state, price: action.value};

    case 'ADD_EXCHANGE':
      return {...state, wantChange: action.value};

    case 'ADD_PHONE':
      return {...state, phone: action.value};

    case 'ADD_IMAGES':
      return {...state, images: action.value};

    case 'REFRESH':
      return {
        ...state,
        images: [
          {
            uri:
              'data:image/png;base64,',
          },
          {
            uri:
              'data:image/jpeg;base64,',
          },
          {
            uri:
              'data:image/jpeg;base64,',
          },
          {
            uri:
              'data:image/jpeg;base64,',
          },
          {
            uri:
              'data:image/jpeg;base64,',
          },
          {
            uri:
              'data:image/jpeg;base64,',
          },
        ],

        name: '',
        description: '',
        section: 'انتخاب',

        location: 'هرات',
        type: 'فروشی',
        state: 'نوع',
        price: 'تعین',
        wantChange: false,
        phone: '',
        id: '',
        count: 1,
      };

    default:
      return state;
  }
};

export default ThingSpecificationReducer;
